export const useRentalSearch = (rentalList, searchValue) => {
  const returnList = [];
  rentalList.map((rental) => console.log(rental.title));
  if (searchValue === "") {
    return rentalList;
  } else {
    rentalList.map((rental) => {
      if (rental.title.toLowerCase().indexOf(searchValue)) {
        returnList.push(rental);
      }
    });
  }
  return returnList;
};
